import React from "react";

const SocialShare = [
  {
    iconName: "fa fa-github",
    link: "https://github.com/arifbillah30",
    name: "GitHub"
  },
  { 
    iconName: "fa fa-linkedin", 
    link: "https://www.linkedin.com/in/arifbillah30",
    name: "LinkedIn"
  },
  {
    iconName: "fa fa-twitter",
    link: "https://twitter.com/arifbillah30",
    name: "Twitter"
  },
  { 
    iconName: "fa fa-graduation-cap", 
    link: "https://www.researchgate.net/profile/Arif-Billah",
    name: "ResearchGate"
  },
];

const Social = () => {
  return (
    <div style={{ display: 'flex', justifyContent: 'center', gap: '30px', marginTop: '20px' }}>
      {SocialShare.map((val, i) => (
        <a 
          key={i}
          href={val.link} 
          target="_blank" 
          rel="noreferrer"
          style={{ 
            textDecoration: 'none', 
            color: 'inherit',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            gap: '8px'
          }}
        >
          <i className={val.iconName} style={{ fontSize: '24px' }}></i>
          <span style={{ fontSize: '14px' }}>{val.name}</span>
        </a>
      ))}
    </div>
  );
};

export default Social;
